import React, { useState } from "react";
import { useParams } from "react-router-dom";
import "./style.css";

const GroupDetail = ({ groups }) => {
  const { id } = useParams();
  const group = groups.find((group) => group.id === id);

  const [showEditModal, setShowEditModal] = useState(false);
  const [showDeleteModal, setShowDeleteModal] = useState(false);
  const [password, setPassword] = useState("");

  const handleLike = () => {
    // 공감수를 증가시키는 로직을 추가하세요.
    console.log("공감 보내기");
  };

  const handleEditGroup = () => {
    // 비밀번호 검증 후 그룹 정보를 수정하는 로직을 추가하세요.
    console.log("그룹 정보 수정");
  };

  const handleDeleteGroup = () => {
    // 비밀번호 검증 후 그룹을 삭제하는 로직을 추가하세요.
    console.log("그룹 삭제");
  };

  if (!group) {
    return <p>그룹을 찾을 수 없습니다.</p>;
  }

  return (
    <div className="group-detail-container">
      <div className="group-detail-header">
        <img src={group.image} alt={group.title} className="group-image" />
        <div className="group-info">
          <h1>{group.title}</h1>
          <p>{group.description}</p>
          <p>공개 여부: {group.isPublic ? "공개" : "비공개"}</p>
          <p>디데이: {group.daysSinceCreation}일</p>
        </div>
        <button onClick={handleLike} className="like-button">
          공감 보내기
        </button>
      </div>
      <div className="group-badges">
        <span>추억: {group.memoriesCount}</span>
        <span>추억 공감: {group.likes}</span>
        <span>추천: {group.recommendations}</span>
      </div>
      <div className="memories-list">
        <h2>추억 목록</h2>
        {group.memories && group.memories.length > 0 ? (
          group.memories.map((memory, index) => (
            <div key={index} className="memory-item">
              <p>{memory}</p>
            </div>
          ))
        ) : (
          <p>게시된 추억이 없습니다.</p>
        )}
      </div>

      <button onClick={() => setShowEditModal(true)}>그룹 수정</button>
      <button onClick={() => setShowDeleteModal(true)}>그룹 삭제</button>

      {showEditModal && (
        <div className="modal">
          <div className="modal-content">
            <h2>그룹 정보 수정</h2>
            <input
              type="password"
              placeholder="비밀번호 입력"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <button onClick={handleEditGroup}>수정하기</button>
            <button onClick={() => setShowEditModal(false)}>취소</button>
          </div>
        </div>
      )}

      {showDeleteModal && (
        <div className="modal">
          <div className="modal-content">
            <h2>그룹 삭제</h2>
            <input
              type="password"
              placeholder="비밀번호 입력"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <button onClick={handleDeleteGroup}>삭제하기</button>
            <button onClick={() => setShowDeleteModal(false)}>취소</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default GroupDetail;
